import React from "react";
function Audionav(props) {
  return (
    <div className="audionav">
      <h1>{props.text}</h1>
      <input id="songbar" type="range" name="range" min="0 " max="100" />
      <audio id="audd">
        <source src="Songs/PhoolanSa.mp3" />
      </audio>
    </div>
  );
  var ad = document.getElementById("audd");
  console.log(ad.duration);
}
export default Audionav;
